import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{o as t,c as n,f as e}from"./app-9dabb852.js";const a={},r=e('<div class="hint-container info"><p class="hint-container-title">为什么我显示不支持？</p><p>网络被各种路由或者运营商套娃了，如一些餐厅网，校园网（浏览器网页登陆验证而非宽带拨号），酒店网，公司网和插流量卡的移动WIFI，手机流量等，就会因为被多层NAT设备套娃或者防火墙限制而无法穿透，就会不支持了<br> 或者可能你没给Windows防火墙点允许 <strong>（弹出问你是否允许访问网络，以及右侧弹出问你是否希望被网络内其他设备发现的的弹窗，点专用网络+公用网络，点允许）</strong></p><p><strong>我还能抢救吗？</strong><br> 可以试一试看，<strong>得花点时间和耐心</strong>，如果你是在用你自己的家庭网络，且可以登陆后台操作的话。</p></div><h2 id="查看路由网关路线" tabindex="-1"><a class="header-anchor" href="#查看路由网关路线" aria-hidden="true">#</a> <strong>查看路由网关路线</strong></h2><p>按win+r然后粘贴这个运行 <code>cmd /k tracert -4 -d -h 6 baidu.com</code></p><figure><img src="https://img.514.live/img/202308011715468.png" alt="一个示例" width="480" height="320" tabindex="0" loading="lazy"><figcaption>一个示例</figcaption></figure><p>此示例中，他有两个路由器<code>（192.168.88.1 和 192.168.1.1）</code>和一个光猫（天翼网关）<code>（100.xxx）</code><br>  <br> 输入 ipconfig 可查看本机内网IP并二次确认自己电脑的上级路由器（网关）</p><figure><img src="https://img.514.live/img/202308020958010.png" alt="示例中内网IP为192.168.88.4，默认网关为192.168.88.1" width="480" height="320" tabindex="0" loading="lazy"><figcaption>示例中内网IP为192.168.88.4，默认网关为192.168.88.1</figcaption></figure><div class="hint-container warning"><p class="hint-container-title">注意</p><p>其他情况比如校园网（<code>10.xxx</code> 浏览器网页登陆验证），手机热点，酒店公司餐厅等公共场所，直接不用继续看了，没办法去操作的。</p></div><h2 id="第一种办法-直接让自己电脑接到拨号源头-如果是光猫拨号就接到光猫上-如果是光猫桥接路由器拨号-就接到对应路由器上" tabindex="-1"><a class="header-anchor" href="#第一种办法-直接让自己电脑接到拨号源头-如果是光猫拨号就接到光猫上-如果是光猫桥接路由器拨号-就接到对应路由器上" aria-hidden="true">#</a> <strong>第一种办法：直接让自己电脑接到拨号源头（如果是光猫拨号就接到光猫上，如果是光猫桥接路由器拨号，就接到对应路由器上）</strong></h2><figure><img src="https://img.514.live/img/202308021156282.png" alt="天翼网关后台，接光纤的光猫" width="630" height="350" tabindex="0" loading="lazy"><figcaption>天翼网关后台，接光纤的光猫</figcaption></figure><p>然后再次做tracert与ipconfig进行确认<br> 同时进行AP检测，一般是可以支持的了，还是不行的话，参考下面设置光猫桥接路由拨号或者NAT端口转发</p><figure><img src="https://img.514.live/img/202308021106106.png" alt="本例中，将电脑直接连在拨号的天翼网关192.168.1.1上，成功恢复支持AP" tabindex="0" loading="lazy"><figcaption>本例中，将电脑直接连在拨号的天翼网关192.168.1.1上，成功恢复支持AP</figcaption></figure><h2 id="第二种办法-没法接到远处的路由器上-那就尝试设置路由器端口转发开放端口" tabindex="-1"><a class="header-anchor" href="#第二种办法-没法接到远处的路由器上-那就尝试设置路由器端口转发开放端口" aria-hidden="true">#</a> <strong>第二种办法：没法接到远处的路由器上，那就尝试设置路由器端口转发开放端口</strong></h2><p>在浏览器地址栏中输入 网关IP 则可进入家用路由器后台（<strong>注意别变成百度搜索这个IP了</strong>），本例中是 <code>192.168.88.1</code><br> 顺便比对品牌和网线确认电脑是连接到哪个路由器，默认账号密码应该在路由器上有贴纸，登陆后进入后台</p><figure><img src="https://img.514.live/img/202308021021641.png" alt="示例，成功进入后台" tabindex="0" loading="lazy"><figcaption>示例，成功进入后台</figcaption></figure><div class="hint-container info"><p class="hint-container-title">相关信息</p><p>找到并打开UPNP设置，<br> 设置多个NAT端口转发或虚拟服务器（设置多个端口如10800、10801...10810，以后可能需要切换着用），协议选择UDP或者BOTH, ALL，输入自己的本机内网IP<br> 也可以使用DMZ主机，就是相当于给所有端口都开放暴露，不推荐小白使用</p></div><figure><img src="https://img.514.live/img/202308021031896.png" alt="路由器一般都有这些设置，光猫如果不是超级管理员账号登陆可能没有" width="450" height="360" tabindex="0" loading="lazy"><figcaption>路由器一般都有这些设置，光猫如果不是超级管理员账号登陆可能没有</figcaption></figure><div class="hint-container info"><p class="hint-container-title">相关信息</p><p>设置完毕后再进行AP检测，可能可以有效，可能还是无效。<br> 还是无效就算了没救了；<br> 有效的话，在DHCP设置里给自己的电脑（根据内网IP判断哪个设备是自己的电脑）设置静态保留内网IP，这是为了防止每次重启网络后电脑的内网IP变化</p><p>之后应该就没什么问题了。</p></div><figure><img src="https://img.514.live/img/202308021205743.png" alt="不同设备的设置界面关键词可能不一样，DHCP，静态，保留" width="450" height="360" tabindex="0" loading="lazy"><figcaption>不同设备的设置界面关键词可能不一样，DHCP，静态，保留</figcaption></figure>',18),g=[r];function o(c,p){return t(),n("div",null,g)}const h=i(a,[["render",o],["__file","AP_NOT_Supported.html.vue"]]);export{h as default};
